import React from "react";
import "./Menu.css"

const Menu= () => {

    return Menu (
        <div className="menu">
            <ul className="nav">
                <li className="line"> <a href="#" className="link">ABOUT US</a></li>
                <li className="line"> <a href="hotel.html" className="link">HOTEL</a></li>
                <li className="line"> <a href="contact.html" className="link">CONTACT US</a></li>
            </ul>
        </div>
    );
};

export default Menu;
